import React from 'react';
import Collapse from '../components/collapse';

function About() {
  return (
    <div className="about">
      <Collapse title="Fiabilité">
      </Collapse>
      <Collapse title="Respect">
      </Collapse >
      <Collapse title="Sercice">
      </Collapse>
      <Collapse title="Sécurité"> 
      </Collapse>
    </div>
  );
}

export default About;
